// JavaScript Document
// Click handler for the color map
$('#color-map').on('click', function(e) {
    // utility function for finding the position of the clicked pixel
    function findPos(obj) {
        var curleft = 0, curtop = 0;
        if (obj.offsetParent) {
            do {
                curleft += obj.offsetLeft;
                curtop += obj.offsetTop;
            } while (obj = obj.offsetParent);
            return { x: curleft, y: curtop };
        }
        return undefined;
    }
    // get the position of clicked pixel
    var pos = findPos(this);
    var x = e.pageX - pos.x;
    var y = e.pageY - pos.y;
    // get reference to canvas element clicked on
    var canvas = this.getContext('2d');
    // return array of [RED,GREEN,BLUE,ALPHA] as 0-255 of clicked pixel
    var pixel = canvas.getImageData(x, y, 1, 1).data;
    // the color-map image, represented by the URI below, is drawn transparent and laid overtop of the rest of the page.  Although it is transparent, the browser
    // can still pick up details of a pixel, in this case it's color.  the RGB values are stored in an array: pixel[0], pixel[1], and pixel[2].  we test for the color
    // we clicked on to see if it matches any of the colors we're looking for.  if so, we have a match and know which wavelength was clicked on, which we then display
    // using .show();
    // Not neccesary, but we could also add pixel[3] == 0 to make sure we're only checking pixels with an alpha value of 0 (which means its completely transparent).
    // However, our color map takes up the entire image space, so we don't have to worry about the user clicking on something that is not the color map.
    if ((pixel[0] == '255') && (pixel[1] == '0') && (pixel[2] == '255')){
      hide_all_graphs();
      $('#purple_graph').show();
      $('#grayscale_graph').addClass('half_opacity');
    } else if ((pixel[0] == '102') && (pixel[1] == '255') && (pixel[2] == '51')) {
      hide_all_graphs();
      $('#green_graph').show();
      $('#grayscale_graph').addClass('half_opacity');
    } else if ((pixel[0] == '51') && (pixel[1] == '102') && (pixel[2] == '255')) {
      hide_all_graphs();
      $('#blue_graph').show();
      $('#grayscale_graph').addClass('half_opacity');
    } else if ((pixel[0] == '51') && (pixel[1] == '203') && (pixel[2] == '203')) {
      hide_all_graphs();
      $('#teal_graph').show();
      $('#grayscale_graph').addClass('half_opacity');
    } else {
      $('#grayscale_graph').removeClass('half_opacity');
      hide_all_graphs();
    }
});

// get reference to canvas DOM element
var canvas = $('#color-map')[0];
// get reference to canvas context
var context = canvas.getContext('2d');

// create an empty image
var img = new Image();
// after loading...
img.onload = function() {
    // draw the image onto the canvas
    context.drawImage(img, 0, 0);
}

// once you have created your color map and saved it as an image file (.jpg/.png usually), use a URI converter
img.src = "data:image/png;base64,"; //transparent png